import Card from "./shared/Card";
function FeedbackForm() {
    return (<Card>
                <form >
                    <h2>How would you rate us?</h2>
                    <input type="text" placeholder="Rate us" />
                </form>
            </Card>);
}

export default FeedbackForm;
